import React, { useState } from 'react';

import Counter from "../Counter";
import DashTile from "./DashTile";



export default function DashTileGroup() {
    // Declare a new state variable, which we'll call "count"
    const [count, setCount] = useState(0);

    return (
                <div className="px-3 py-2 rounded-md border-2 border-green-500 text-sm font-medium text-white bg-gray-900 focus:outline-none focus:text-white focus:bg-gray-700">
                    <div className="flex flex-row divide-x gap-x-2">

                            <div className="flex flex-column">

                                <div className="p-1 text-left font-bold">
                                   Social Media Stocks
                                </div>
                                <div className="flex flex-row">
                                    <div className="text-left font-bold">
                                        Social Media Stocks
                                    </div>
                                    <div className="text-left font-bold">
                                        +5%
                                    </div>
                                </div>
                            </div>
                        <div className=" flex flex-row">
                                <DashTile/>
                                <DashTile/>
                                <DashTile/>
                                <DashTile/>
                        </div>
                    </div>
                </div>
    );
}
